import ENUMS from "constants/appEnums";

const projectTable = [
    {
        title: 'Job #',
        dataIndex: 'job_number',
        render: (text) => text,
    },
    {
        title: 'Project name',
        dataIndex: 'project_name',
    },
    {
        title: 'Created by',
        dataIndex: 'created_by',
    },
    {
        title: 'Created date',
        dataIndex: 'created_at_date',
    },
    {
        title: 'Created time',
        dataIndex: 'created_time',
    },
];

const jobInfoFormTableData = {
    columns: [
        { key: "1", label: "", width: "50%" },
        { key: "2", label: "", width: "50%" },
    ],
    grid: [
        {
          rows: [
            {label: 'Job name', field: ENUMS.FORM_FIELDS.JOB_INFO.JOB_NAME, required: true},
            {label: 'Job type', field: ENUMS.FORM_FIELDS.JOB_INFO.JOB_TYPE, required: true},
            {label: 'Job id', field: ENUMS.FORM_FIELDS.JOB_INFO.JOB_ID, required: true},
            {label: 'AFE #', field: ENUMS.FORM_FIELDS.JOB_INFO.AFE_NUM, required: true},
            {label: 'Country', field: ENUMS.FORM_FIELDS.JOB_INFO.COUNTRY, required: true},
            {label: 'Basin', field: ENUMS.FORM_FIELDS.JOB_INFO.BASIN, required: true},
            {label: 'State', field: ENUMS.FORM_FIELDS.JOB_INFO.STATE, required: true},
            {label: 'Start date', field: ENUMS.FORM_FIELDS.JOB_INFO.START_DATE, required: true},
          ]
        }
    ]
}

const padInfoFormTableData = {
    columns: [
        { key: "1", label: "", width: "50%" },
        { key: "2", label: "", width: "50%" },
    ],
    grid: [
        {
          rows: [
            {label: 'Pad name', field: ENUMS.FORM_FIELDS.PAD_INFO.PAD_NAME, required: true},
            {label: 'Pad Id', field: ENUMS.FORM_FIELDS.PAD_INFO.PAD_ID, required: true},
            {label: 'Client name', field: ENUMS.FORM_FIELDS.PAD_INFO.CLIENT_NAME, required: true},
            {label: 'Customer field rep', field: ENUMS.FORM_FIELDS.PAD_INFO.CUSTOMER_FIELD_REP, required: true},
            {label: 'Rep contact #', field: ENUMS.FORM_FIELDS.PAD_INFO.REP_CONTACT_NUMBER, required: true},
            {label: 'Operator', field: ENUMS.FORM_FIELDS.PAD_INFO.OPERATOR, required: true},
            {label: 'Service company', field: ENUMS.FORM_FIELDS.PAD_INFO.SERVICE_COMPANY, required: true},
            {label: 'Wireline company', field: ENUMS.FORM_FIELDS.PAD_INFO.WIRELINE_COMPANY, required: true},
          ]
        }
    ]
}

const wellInfoFormTableData = {
    columns: [
        { key: "1", label: "Well name", width: "15%", field: ENUMS.FORM_FIELDS.WELL_INFO.WELL_NAME, defaultValue: "", required: true },
        { key: "2", label: "Well API", width: "16%", field: ENUMS.FORM_FIELDS.WELL_INFO.WELL_API, defaultValue: "", required: true },
        { key: "3", label: "Formation", width: "16%", field: ENUMS.FORM_FIELDS.WELL_INFO.FORMATION, defaultValue: "", required: true },
        { key: "4", label: "Lat", width: "16%", field: ENUMS.FORM_FIELDS.WELL_INFO.LAT, defaultValue: "", required: true },
        { key: "5", label: "Easting", width: "16%", field: ENUMS.FORM_FIELDS.WELL_INFO.EASTING, defaultValue: "", required: true },
        { key: "6", label: "Northing", width: "16%", field: ENUMS.FORM_FIELDS.WELL_INFO.NORTHING, defaultValue: "", required: true },
        { key: "7", label: "", width: "5%", field: "action", defaultValue: "", actionColumn: true, className: "noborder" },
    ],
    grid: [
        {
          row: "row1"
        }
    ]
}

const wellVolumeFormTableData = {
    columns: [
        { key: "1", label: "Type", width: "16%", field: ENUMS.FORM_FIELDS.WELL_VOLUME.TYPE, required: true },
        { key: "2", label: "OD", width: "16%", field: ENUMS.FORM_FIELDS.WELL_VOLUME.OD, required: true },
        { key: "2", label: "Wt", width: "17%", field: ENUMS.FORM_FIELDS.WELL_VOLUME.WT, required: true },
        { key: "2", label: "ID", width: "17%", field: ENUMS.FORM_FIELDS.WELL_VOLUME.ID, required: true },
        { key: "2", label: "Depth [MD]", width: "17%", field: ENUMS.FORM_FIELDS.WELL_VOLUME.DEPTH_MD, required: true },
        { key: "2", label: "TOL", width: "17%", field: ENUMS.FORM_FIELDS.WELL_VOLUME.TOL, required: true },
    ],
    grid: [
        {
          rows: [
            'Casing',
            'Liner #1',
            'Liner #2'
          ]
        }
    ]
}

const wellVolumeEstimationsFormTableData = {
    columns: function (wellName) {
        return [
            { key: "1", label: wellName, colSpan: "2" },
        ]
    },
    grid: [
        {
          rows: [
            {label: 'Surface Vol. [bbls]', field: ENUMS.FORM_FIELDS.WELL_VOLUME_ESTIMATIONS.SURFACE_VOL},
            {label: 'bbls', field: ENUMS.FORM_FIELDS.WELL_VOLUME_ESTIMATIONS.BBLS},
            {label: 'gallons', field: ENUMS.FORM_FIELDS.WELL_VOLUME_ESTIMATIONS.GALLONS},
          ]
        }
    ]
}

const clientInfoFormTableData = {
    columns: [
        { key: "1", label: "Client Username", width: "40%", field: ENUMS.FORM_FIELDS.CLIENT_INFO.CLIENT_USERNAME, required: true },
        { key: "2", label: "Title", width: "30%", field: ENUMS.FORM_FIELDS.CLIENT_INFO.TITLE, required: true },
        { key: "2", label: "Password", width: "30%", field: ENUMS.FORM_FIELDS.CLIENT_INFO.PASSWORD, required: true, component: <input type="password"></input>, forceComponent: true, className: 'p-0' },
    ],
    grid: [
        {
          rows: [
            ''
          ]
        }
    ]
}

const crewInfoFormTableData = {
    columns: [
        { key: "1", label: "Role", width: "40%", field: ENUMS.FORM_FIELDS.CREW_INFO.ROLE, required: true },
        { key: "2", label: "Name", width: "30%", field: ENUMS.FORM_FIELDS.CREW_INFO.NAME, required: true },
        { key: "2", label: "Contact", width: "30%", field: ENUMS.FORM_FIELDS.CREW_INFO.CONTACT, required: true },
    ],
    grid: [
        {
          rows: [
            {label: 'Engineering manager'},
            {label: 'Field engineer'},
            {label: 'Field engineer'},
            {label: 'Field engineer'},
          ]
        }
    ]
}

const equipmentFormTableData = {
    columns: [
        { key: "1", label: "Equipment", width: "50%" },
        { key: "1", label: "ID #", width: "50%" },
    ],
    grid: [
        {
          rows: [
            {label: 'Trailers', field: ENUMS.FORM_FIELDS.EQUIPMENT.TRAILERS, required: true },
            {label: 'Powerpack', field: ENUMS.FORM_FIELDS.EQUIPMENT.POWERPACK, required: true },
            {label: 'Source', field: ENUMS.FORM_FIELDS.EQUIPMENT.SOURCE, required: true },
            {label: 'Accumulator', field: ENUMS.FORM_FIELDS.EQUIPMENT.ACCUMULATOR, required: true },
            {label: 'Hydrophones', field: ENUMS.FORM_FIELDS.EQUIPMENT.HYDROPHONES, required: true },
            {label: 'PSI transducer', field: ENUMS.FORM_FIELDS.EQUIPMENT.PSI_TRANSDUCER, required: true },
            {label: 'Hotspot', field: ENUMS.FORM_FIELDS.EQUIPMENT.HOTSPOT, required: true },
          ]
        }
    ]
}

const TableHeadersUtil = {
    clientInfoFormTableData,
    crewInfoFormTableData,
    jobInfoFormTableData,
    padInfoFormTableData,
    projectTable,
    wellInfoFormTableData,
    wellVolumeFormTableData,
    wellVolumeEstimationsFormTableData,
    equipmentFormTableData
}

export default TableHeadersUtil;
